import React, { useEffect, useState } from 'react';
import { getLikedVideos } from '../api/youtube';

const LoginYouTube = () => {
  const [likedVideos, setLikedVideos] = useState([]);

  const fetchLikedVideos = async () => {
    try {
      const data = await getLikedVideos();
      setLikedVideos(data.items || []); // Set the liked videos from the response
    } catch (error) {
      console.error('Error fetching YouTube liked videos:', error);
    }
  };

  useEffect(() => {
    fetchLikedVideos(); // Fetch liked videos on component mount
  }, []);

  return (
    <div>
      <h2>YouTube Liked Videos</h2>
      <button onClick={fetchLikedVideos}>Refresh Liked Videos</button>
      <ul>
        {likedVideos.map((video) => (
          <li key={video.id}>{video.snippet.title}</li>
        ))}
      </ul>
    </div>
  );
};

export default LoginYouTube;
